import styled from "styled-components";

const Login = (props) => {
    return (
        <Container>
            <Nav>
                <a href="/">
                    <img src= "/images/tunein.svg" alt=""></img>
                </a>
            </Nav>
        </Container>
    )
};

const Container = styled.div`
    padding: 0px;
`;
const Nav = styled.nav`
    max-width: 1128px;
`;
export default Login;
